import React from "react";

const ArticleSlider = () => {
    return (
        <section class="top-image-section relative">
            <div class="centralize">
                <h2 class="top-image-section-title text-capitalize white font-weight-bold">
                    latest blog title
                </h2>
                <p class="top-image-section-date white">May 20, 2019</p>
            </div>
        </section>
    );
};

export default ArticleSlider;
